6	/privacy-policy/	Privacy Policy	<p><strong>Wizoku</strong> the trading name of Minerva Education Ltd whose registered office is c/o Shelley Stock Hutter LLP, 1<sup>st</sup> Floor, 7-10 Chandos Street, London, W1G 9DQ with company number: 07889415] (<strong>We</strong>) are committed to protecting and respecting your privacy.&nbsp;</p>\r\n<p>References to wizoku are deemed references to Minerva Education Ltd as owner and operator of the wizoku website (<strong>Website</strong>).&nbsp;</p>\r\n<p>This policy (together with our <a href="/terms-and-conditions/">terms and conditions</a> and any other documents referred to on it) sets out the basis on which any personal data we collect from you, or that you provide to us, will be processed by us. &nbsp;</p>\r\n<p>Please read the following carefully to understand our views and practices regarding your personal data and how we will treat it. By accessing and using the Website or by supplying your personal information online, by telephone or in writing you agree to your personal data being processed by us in accordance with this policy and you agree to this privacy policy.</p>\r\n<p>For the purpose of the Data Protection Act 1998 (the <strong>Act</strong>), the data controller is <strong>wizoku</strong> of c/o Shelley Stock Hutter LLP, 1<sup>st</sup> Floor, 7-10 Chandos Street, London, W1G 9DQ.&nbsp;</p>\r\n<p>Our nominated representative for the purpose of the Act is Nick Crosthwaite of c/o Shelley Stock Hutter LLP, 1<sup>st</sup> Floor, 7-10 Chandos Street, London, W1G 9DQ.</p>\r\n<p>&nbsp;</p>\r\n<h3><strong>Information we may collect from you</strong></h3>\r\n<p>We may collect and process the following data about you:</p>\r\n<ul>\r\n<li>Information that you provide by filling in forms on our site <a href="/">www.wizoku.com</a>&nbsp;(<strong>our site</strong>). This includes information provided at the time of registering to use our site, subscribing to our service, posting material or requesting further services. We may also ask you for information when you report a problem with our site.</li>\r\n<li>If you contact us, we may keep a record of that correspondence.</li>\r\n<li>We may also ask you to complete surveys that we use for research purposes, although you do not have to respond to them.</li>\r\n<li>Details of transactions you carry out through our site and of the fulfilment of your orders.</li>\r\n<li>Details of your visits to our site including, but not limited to, traffic data, location data, weblogs and other communication data, whether this is required for our own billing purposes or otherwise and the resources that you access.&nbsp;</li>\r\n<li>information that is recorded during an Online Tutoring Session.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<h3><strong>IP addresses</strong></h3>\r\n<p>We may collect information about your computer, including where available your IP address, operating system and browser type, for system administration and to report aggregate information to our advertisers. This is statistical data about our users' browsing actions and patterns, and does not identify any individual.</p>\r\n<p>&nbsp;</p>\r\n<h3><strong>Cookies</strong></h3>\r\n<p>Our website uses cookies to distinguish you from other users of our website. This helps us to provide you with a good experience when you browse our website and also allows us to improve our site. For detailed information on the cookies we use and the purposes for which we use them please contact us.</p>\r\n<p>&nbsp;</p>\r\n<h3><strong>Where we store your personal data / Security&nbsp;</strong></h3>\r\n<p>The data that we collect from you may be transferred to, and stored at, a destination outside the European Economic Area ("EEA"). It may also be processed by staff operating outside the EEA who work for us or for one of our suppliers. Such staff maybe engaged in, among other things, the processing of your payment details and the provision of services. By submitting your personal data, you agree to this transfer, storing or processing. We will take all steps reasonably necessary to ensure that your data is treated securely and in accordance with this privacy policy.</p>\r\n<p>We do have security measures in place to protect our clients / customers and customer database. Access to this database is restricted internally to those employees who need access so they can perform their jobs. However it remains your responsibility to protect against unauthorised access to your profile and to ensure that no one else uses the computer you are on to access the site whilst you are on the site other than in accordance with the terms and conditions. You must log off correctly from the site when not using it and keep your password secret. &nbsp;</p>\r\n<p>Unfortunately, the transmission of information via the internet is not completely secure. Although we will do our best to protect your personal data, we cannot guarantee the security of your data transmitted to our site; any transmission is at your own risk. Once we have received your information, we will use strict procedures and security features to try to prevent unauthorised access.</p>\r\n<p>We have the following security in place:-</p>\r\n<p>Cross site scripting (XSS) protection</p>\r\n<p>Cross site request forgery (CSRF) protection</p>\r\n<p>SQL injection protection</p>\r\n<p>Clickjacking protection<br /> <br /> All passwords are also hashed, meaning that not even we can see what a users password is.</p>\r\n<p>&nbsp;</p>\r\n<h3><strong>Uses made of the information</strong></h3>\r\n<p>We use information held about you in the following ways:</p>\r\n<ul>\r\n<li>To ensure that content from our site is presented in the most effective manner for you and for your computer.&nbsp;</li>\r\n<li>To provide you with information or services that you request from us or which we feel may interest you, where you have consented to be contacted for such purposes.&nbsp;</li>\r\n<li>To carry out our obligations arising from any contracts entered into between you and us.</li>\r\n<li>To allow you to participate in interactive features of our service, when you choose to do so.</li>\r\n<li>To notify you about changes to our service.</li>\r\n</ul>\r\n<p>We may also use your data, or permit selected third parties to use your data, to provide you with information about goods and services which may be of interest to you and we or they may contact you about these by post or telephone.&nbsp;</p>\r\n<p>If you are an existing customer, we will only contact you by electronic means (e-mail or SMS) with information about goods and services similar to those which were the subject of a previous sale to you.&nbsp;</p>\r\n<p>If you are a new customer, and where we permit selected third parties to use your data, we (or they) will contact you by electronic means only if you have consented to this.&nbsp;</p>\r\n<p>If you do not want us to use your data in this way, or to pass your details on to third parties for marketing purposes, please tick the relevant box situated on the registration form on which we collect your data.<strong><em>&nbsp;</em></strong></p>\r\n<p><strong><em><br /></em></strong></p>\r\n<h3><strong>Disclosure of your information</strong></h3>\r\n<p>We may disclose your personal information to any member of our group, which means our subsidiaries, our ultimate holding company and its subsidiaries, as defined in section 1159 of the UK Companies Act 2006. We may disclose your personal information to third parties:</p>\r\n<ul>\r\n<li>In the event that we sell or buy any business or assets, in which case we may disclose your personal data to the prospective seller or buyer of such business or assets.</li>\r\n<li>If wizoku or substantially all of its assets are acquired by a third party, in which case personal data held by it about its customers will be one of the transferred assets.</li>\r\n<li>If we are under a duty to disclose or share your personal data in order to comply with any legal obligation, or in order to enforce or apply our <a href="/terms-of-use/">terms of use</a> and or <a href="/terms-and-conditions/">terms and conditions</a>&nbsp;and other agreements; or to protect the rights, property, or safety of wizoku, our customers, or others. This includes exchanging information with other companies and organisations for the purposes of fraud protection and credit risk reduction.</li>\r\n</ul>\r\n<p><strong><br /></strong></p>\r\n<h3><strong>Your rights</strong></h3>\r\n<p>You have the right to ask us not to process your personal data for marketing purposes. We will usually inform you (before collecting your data) if we intend to use your data for such purposes or if we intend to disclose your information to any third party for such purposes. You can exercise your right to prevent such processing by checking certain boxes on the forms we use to collect your data.&nbsp; You can also exercise the right at any time by contacting us at <a href="mailto:support@universaltutors.com">support@wizoku.com</a>.</p>\r\n<p>Our site may, from time to time, contain links to and from the websites of our partner networks, advertisers and affiliates.&nbsp; If you follow a link to any of these websites, please note that these websites have their own privacy policies and that we do not accept any responsibility or liability for these policies.&nbsp; Please check these policies before you submit any personal data to these websites.</p>\r\n<p>&nbsp;</p>\r\n<h3><strong>Access to information</strong></h3>\r\n<p>The Act gives you the right to access information held about you. Your right of access can be exercised in accordance with the Act. Any access request may be subject to a fee of &pound;10 to meet our costs in providing you with details of the information we hold about you.</p>\r\n<p>&nbsp;</p>\r\n<h3><strong>Changes to our privacy policy</strong></h3>\r\n<p>Any changes we may make to our privacy policy in the future will be posted on this page and, where appropriate, notified to you by e-mail.</p>\r\n<p>&nbsp;</p>\r\n<h3><strong>Contact</strong></h3>\r\n<p>Questions, comments and requests regarding this privacy policy are welcomed and should be addressed to <a href="mailto:support@universaltutors.com">support@wizoku.com</a>.</p>	f		f
