COPY faq_faqitem (id, section_id, question, answers, "position") FROM stdin;
15	4	How long is each class?	<p>Each class must be at least 30 minutes and be measured in 15 minute increments, but beyond that the duration of the class is entirely up to the tutor and the student.</p>	0
12	4	How should I pick the best tutor for me?	<p>We offer a great selection of tutors from around the world. Students can <a class="internal" title="search" href="http://www.wizoku.com/search/">search for the subject</a> they want help with, and then choose from the list of tutors for that subject. Students should make their decisions based on the experience of the tutor, reviews they&rsquo;ve received, and any other qualities the student might be looking for, such as personality, teaching style, and so on. We also advise you to chat with a tutor through our messaging system before you commit to a session to ensure you make the best choice possible.</p>	0
9	2	How do I sign up?	<p>Signing up as a student is extremely simple. We&rsquo;ve designed it this way to help you get the help you need as quickly and conveniently as possible. You can add to your profile later, but to get started all you need is to click the sign up link and fill in the basic information we ask for.</p>	0
10	2	Im under 16. Do I need a parent to sign up with me?	<p>We do ask that students under the age of 16 have a parent authorize their sign-up. To do this, you can give us their email address when you sign up and we&rsquo;ll send them an email asking them to confirm your account. You can then move forward with the sign-up process and your parent can then decide to create an account to oversee your activity or not.</p>	0
11	3	How do parent accounts work?	<p>We understand that you often want to have oversight of your child&rsquo;s activity and progress on wizoku, so we have created separate Parent Accounts that are linked to student accounts. From this account you can track the feedback they have received from their tutors, view the recording of the class, communicate with their tutors and pay for their classes.</p>	0
37	9	What is the referral system and how does it work?	<p>The referral system allows you to benefit by encouraging your friends, family, and colleagues to use wizoku. If you refer someone, we&rsquo;ll thank you by giving you free credits or a commission-free class (for students and tutors respectively) for each active user that you refer.</p>	0
38	9	What should I do if I come across any inappropriate content on the site?	<p>In the unlikely event of inappropriate content appearing on the site, there are flags throughout the site that you can click on to report anything. We do our best to make sure that this never happens, but we encourage you to help us monitor the wizoku community to ensure both safety and quality.</p>	0
39	9	The subject Im looking for is not listed. What do I do?	<p>We want to provide the best experience for students of all needs, so please <a class="internal" title="contact us" href="http://www.wizoku.com/contact-us/">contact us</a> at if you think there is a subject we should add and we&rsquo;ll do our best to make it happen.</p>	0
36	9	I forgot my password/username. What do I do?	<p>On the log-in screen, you will find a &ldquo;<a class="internal" title="forgot your password" href="http://www.wizoku.com/accounts/password/reset/">forgot your password</a>&rdquo; button. Click this, give us your email address, and we&rsquo;ll send you an email where you can click on a link to change your password.</p>	0
40	9	How can I provide feedback to wizoku?	<p>We sincerely appreciate all feedback, positive and negative. To provide feedback on any aspects of the site or your experience, just click on the small green tab to the left of the page, which will allow you to complete a short survey. You can also go to the <a class="internal" title="contact us" href="http://www.wizoku.com/contact-us/">Contact Us</a> page (link at the bottom of each page) to let us know about your wizoku experience. Please also email us at nick@wizoku.com and we&rsquo;ll get back to you as soon as we possibly can.</p>	0
1	10	What is wizoku?	<div class="OutlineElement Ltr SCX72873459" style="margin: 0px; padding: 0px; color: #000000; font-family: Times; font-size: 16px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px;">\r\n<p class="Paragraph SCX72873459" style="margin: 0px; padding: 0px; word-wrap: break-word; font-weight: normal; font-style: normal; vertical-align: baseline; font-family: 'Segoe UI', Tahoma, Verdana, Sans-Serif; font-size: 6pt; background-color: transparent; color: windowtext; text-align: left; text-indent: 0px;"><span class="TextRun SCX72873459" style="margin: 0px; padding: 0px; font-size: 11pt; font-family: Calibri, sans-serif; line-height: 17px;"><span class="SpellingError SCX72873459" style="margin: 0px; padding: 0px; background-image: url(data:image/gif; base64,r0lgodlhbqaeajecap////8aaaaaaaaaach5baeaaaialaaaaaafaaqaaaiilgaxcchrtcgaow==); border-bottom-style: solid; border-bottom-width: 1px; border-bottom-color: transparent; background-color: inherit; background-position: 0% 100%; background-repeat: repeat no-repeat;">Wizoku</span><span class="NormalTextRun SCX72873459" style="margin: 0px; padding: 0px; background-color: inherit;"><span class="Apple-converted-space">&nbsp;</span>is an online education community that offers a complete online tutoring service for students and educators across the globe. Our easy-to-use platform allows students and parents to choose from the best tutors available and work around their own schedules to have the best learning experience. <br /></span></span></p>\r\n</div>	0
41	10	Is wizoku right for me? 	<p><span class="TextRun SCX22143085" style="margin: 0px; padding: 0px; color: #000000; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; font-size: 11pt; font-family: Calibri, sans-serif; line-height: 17px;"><span class="SpellingError SCX22143085" style="margin: 0px; padding: 0px; background-image: url(data:image/gif; base64,r0lgodlhbqaeajecap////8aaaaaaaaaach5baeaaaialaaaaaafaaqaaaiilgaxcchrtcgaow==); border-bottom-style: solid; border-bottom-width: 1px; border-bottom-color: transparent; background-color: inherit; background-position: 0% 100%; background-repeat: repeat no-repeat;">Wizoku</span><span class="NormalTextRun SCX22143085" style="margin: 0px; padding: 0px; background-color: inherit;"><span class="Apple-converted-space">&nbsp;</span>is more than any old online tutoring site. We offer a first-class selection of educational tools: high-quality video for classes, an online classroom equipped with Wolfram Alpha, and a</span></span><span class="TextRun SCX22143085" style="margin: 0px; padding: 0px; color: #000000; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; font-size: 11pt; font-family: Calibri, sans-serif; line-height: 17px;"><span class="NormalTextRun SCX22143085" style="margin: 0px; padding: 0px; background-color: inherit;"><span class="Apple-converted-space">&nbsp;</span>free</span></span><span class="TextRun SCX22143085" style="margin: 0px; padding: 0px; color: #000000; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; font-size: 11pt; font-family: Calibri, sans-serif; line-height: 17px;"><span class="NormalTextRun SCX22143085" style="margin: 0px; padding: 0px; background-color: inherit;"><span class="Apple-converted-space">&nbsp;</span>question and answer forum that serves as a great resource for quick answers and help.<span class="Apple-converted-space">&nbsp;</span></span><span class="SpellingError SCX22143085" style="margin: 0px; padding: 0px; background-image: url(data:image/gif; base64,r0lgodlhbqaeajecap////8aaaaaaaaaach5baeaaaialaaaaaafaaqaaaiilgaxcchrtcgaow==); border-bottom-style: solid; border-bottom-width: 1px; border-bottom-color: transparent; background-color: inherit; background-position: 0% 100%; background-repeat: repeat no-repeat;">Wizoku</span><span class="NormalTextRun SCX22143085" style="margin: 0px; padding: 0px; background-color: inherit;"><span class="Apple-converted-space">&nbsp;</span>also gives students the freedom to choose from highly rated tutors based on personality, need, and scheduling, because we know that a good education is based on good relationships.</span></span><span class="EOP SCX22143085" style="margin: 0px; padding: 0px; color: #000000; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; font-size: 11pt; line-height: 17px; font-family: Calibri, sans-serif;"><br /></span></p>	0
6	1	Do I need to upload academic accreditation documents?	<p>While we do not currently require tutors to upload any documentation, we do strongly advise you to upload any supporting documentation for your academic and professional qualifications. Students and parents can then view these documents to help them make their decisions on which tutors to use.</p>	0
3	1	How do I sign up?	<p>Our sign up process is designed to be as simple as possible to make things easy for you. Having said that, in order for students to make informed choices around tutor selection we encourage you to invest some time in completing your profile as fully as possible. You are encouraged to select as many subjects as possible that you can tutor as well as providing significant availability in your calendar to enhance your chances of being selected for tutoring.</p>	0
4	1	How do I build my profile?	<p>Once you&rsquo;ve created your tutor account, you should begin building your profile. The more information you put on, the more likely you are to attract students. We recommend that you put as much of the following information on your profile as possible: academic qualifications, professional background, introductory video, lesson plans, and so on.</p>	0
5	1	How much should I charge?	<p>We leave pricing entirely up to you, so that you can determine the best price based on your own experience. We do suggest, however, that you <a class="internal" title="search" href="http://www.wizoku.com/search/">look at what tutors with similar backgrounds and experience are charging </a>so that you can remain competitive in our active marketplace.</p>	0
8	1	How does wizoku help me work with more students and expand my business	<p>By joining wizoku, you&rsquo;ll be joining a highly active online community of students, parents, and educators. Through the reach of the internet, you can reach even more students than ever before. And through the unique wizoku experience, you can connect with students from around the world on a highly personal level. Wizoku removes the internet anonymity and impersonal effects that often come with online tutoring, which not only improves your experience as a tutor, but also gives your students more opportunities to learn and succeed.</p>	0
44	3	Can I create an account for my child(ren)?	<p>You can create an account for your child(ren), but they will be the ones using it. You can monitor their progress through a Parent Account.</p>	0
13	4	How does wizoku select tutors for the site?	<p>At wizoku we expect our students to be the best judges of tutor quality. We are after all an open marketplace and therefore rely on user ratings and reviews. Nonetheless, we carefully vet every tutor application we receive to ensure that we only allow the highest quality tutors onto the site. We base our decision on an applicant&rsquo;s educational background, their teaching/tutoring experience, and the quality of their profile.</p>	0
16	4	What is the virtual classroom and how does it work?	<p>Our virtual classroom is where online lessons take place. It has the same functionality as a regular classroom, just with added features. Students and tutors set up classes, and then meet in the classroom, where they can video chat, instant message, share documents, and use the interactive whiteboard. These tools are designed to provide as much support as possible for both the student and the tutor.</p>	0
17	4	How do I make sure that Im learning the right stuff?	<p>Classes work best when students provide as much information as possible before the class begins. This can be done either through the class creation form or in the messaging system. With this information, the tutor can prepare for the class and ensure that he/she covers the necessary material in the most productive way possible.</p>	0
18	4	What if I dont like my tutor?	<p>If you realize that your tutor is not right for you for whatever reason, then you are free to cancel that class at no cost within the first 5 minutes. If you complete an entire class with a tutor and are not satisfied for any reason, please give the tutor clear and constructive criticism. We would be happy to help you find a new tutor for your next lesson.</p>	0
45	11	How does the rating and review system for tutors work?	<p>At the end of every class, students are asked to provide a rating and review of their tutor. Ratings will be out of 5 stars, which is a clear way for future students to see which tutors might be best for them. Students are also highly encouraged to add a review, which is a description of how the tutor performed during the lesson.</p>	0
46	11	What kind of feedback can students expect to receive?	<p>Tutors are required to provide feedback on their students at the end of each class. Feedback will come in a message and will highlight to students the areas in which they are strong as well as the areas they need to focus on.</p>	0
47	12	What does wizoku do to ensure classes are safe and secure for both parties?	<p>All of our classes are recorded and accessible to us at a later date should any concerns arise regarding a specific class. Classes will also be monitored at random to ensure that only appropriate material and personal information is being shared. We also encourage students to only use tutors that have had a criminal check done.</p>	0
52	9	Are all classes conducted in English?	<p>Classes are conducted in whichever language a student and tutor decide to use. The majority of the time this language is English. Our classroom can also be used in 20 different languages.</p>	0
48	12	As a parent, what should I do to ensure online safety for my child(ren)?	<p>From a linked parent account, you can track all student activity, including how many classes they&rsquo;re taking, with which tutors, and so on. Parents can also ensure safety by monitoring the recordings of each and every video their child. We also recommend that you sit in on the first class your child takes, so that you understand how that site works and ensure they are practicing safe internet behavior.</p>	0
50	13	Can I take a class on my smartphone or tablet?	<p>Unfortunately, no. Mobile devices are not suitable for taking classes because of their smaller screens and lack of Flash.</p>	0
53	9	Do you offer in-person tutoring?	<p>We are currently working on adding this feature to our site. Keep an eye out and you'll be sure to spot it on the site very soon!</p>	0
51	13	Do I need any special software or equipment to use wizoku?	<p>Nope! All you need is a computer with internet access. To use the video feature of the classroom, you will need a webcam and Adobe Flash installed on your computer. (if you don&rsquo;t have Flash, download it for free <a class="external" title="adobe flash player" href="http://get.adobe.com/flashplayer/" target="_blank">here.</a></p>	0
7	1	. How does the virtual classroom work and can I practice with it?	<p>Our virtual classroom is something that we are very proud of. With some of the most advanced online tools, this classroom makes e-learning easy and effective. To help you take full advantage of this classroom, we have created a video demonstration of the classroom and all its tools. We also offer a private access session of the classroom for tutors to familiarize themselves with it before their first lesson, which can be accessed in your profile.</p>	0
43	2	How should I pick the best tutor for me?	<p>At wizoku, we work to provide the most information on all of our tutors to help you make the best decision possible. Our tutor profiles include experience, academic qualifications, intro videos and more. First <a class="internal" title="search" href="http://www.wizoku.com/search/">search the subject</a> you want to study then explore the list of available tutors and pick the one that best matches your needs. Please <a class="internal" title="contact us" href="http://www.wizoku.com/contact-us/">reach out to us</a> if you need any help with this process!</p>	0
49	12	How do you make sure my financial data is secure?	<p>All personal data is stored securely and is not accessible (excluding your public profile) by any tutors or third parties. All payments are made through <a class="external" title="Paypal" href="https://www.paypal.com/" target="_blank">Paypal</a>, who independently stores your financial data and uses industry-leading security and fraud protection systems.</p>	0
2	10	Who can use wizoku?	<div class="OutlineElement Ltr SCX83799975" style="margin: 0px; padding: 0px; color: #000000; font-family: 'Segoe UI', Tahoma, Verdana, sans-serif; font-size: 8px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px;">\r\n<p class="Paragraph SCX83799975" style="margin: 0px; padding: 0px; word-wrap: break-word; font-weight: normal; font-style: normal; vertical-align: baseline; font-family: 'Segoe UI', Tahoma, Verdana, Sans-Serif; font-size: 6pt; background-color: transparent; color: windowtext; text-align: left; text-indent: 0px;"><span class="TextRun SCX83799975" style="margin: 0px; padding: 0px; font-size: 11pt; font-family: Calibri, sans-serif; line-height: 17px;"><span class="NormalTextRun SCX83799975" style="margin: 0px; padding: 0px; background-color: inherit;">Short answer: anyone! Long(</span><span class="SpellingError SCX83799975" style="margin: 0px; padding: 0px; background-image: url(data:image/gif; base64,r0lgodlhbqaeajecap////8aaaaaaaaaach5baeaaaialaaaaaafaaqaaaiilgaxcchrtcgaow==); border-bottom-style: solid; border-bottom-width: 1px; border-bottom-color: transparent; background-color: inherit; background-position: 0% 100%; background-repeat: repeat no-repeat;">er</span><span class="NormalTextRun SCX83799975" style="margin: 0px; padding: 0px; background-color: inherit;">) answer:<span class="Apple-converted-space">&nbsp;</span></span><span class="SpellingError SCX83799975" style="margin: 0px; padding: 0px; background-image: url(data:image/gif; base64,r0lgodlhbqaeajecap////8aaaaaaaaaach5baeaaaialaaaaaafaaqaaaiilgaxcchrtcgaow==); border-bottom-style: solid; border-bottom-width: 1px; border-bottom-color: transparent; background-color: inherit; background-position: 0% 100%; background-repeat: repeat no-repeat;">Wizoku</span><span class="NormalTextRun SCX83799975" style="margin: 0px; padding: 0px; background-color: inherit;"><span class="Apple-converted-space">&nbsp;</span>is geared towards middle and high school students from around the world. Our tutors come from equally diverse backgrounds. We encourage students, teachers, and parents of all ages and levels to <a class="internal" title="sign up" href="http://www.wizoku.com/">sign up</a> with us. Signing up is as easy as entering your name and email address</span></span><span class="TextRun SCX83799975" style="margin: 0px; padding: 0px; font-size: 11pt; font-family: Calibri, sans-serif; line-height: 17px;"><span class="NormalTextRun SCX83799975" style="margin: 0px; padding: 0px; background-color: inherit;"><span class="Apple-converted-space">&nbsp;</span>or simply connecting with Facebook</span></span><span class="TextRun SCX83799975" style="margin: 0px; padding: 0px; font-size: 11pt; font-family: Calibri, sans-serif; line-height: 17px;"><span class="NormalTextRun SCX83799975" style="margin: 0px; padding: 0px; background-color: inherit;">!&nbsp;</span></span></p>\r\n</div>	0
42	10	 What do I need to use wizoku?	<p><span class="NormalTextRun SCX135557184" style="margin: 0px; padding: 0px; color: #000000; font-family: Calibri, sans-serif; font-size: 14.666666984558105px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 17px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: inherit;">All you need to use </span><span class="SpellingError SCX135557184" style="margin: 0px; padding: 0px; background-image: url(data:image/gif; base64,r0lgodlhbqaeajecap////8aaaaaaaaaach5baeaaaialaaaaaafaaqaaaiilgaxcchrtcgaow==); border-bottom-style: solid; border-bottom-width: 1px; border-bottom-color: transparent; color: #000000; font-family: Calibri, sans-serif; font-size: 14.666666984558105px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 17px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: inherit; background-position: 0% 100%; background-repeat: repeat no-repeat;">wizoku</span><span class="NormalTextRun SCX135557184" style="margin: 0px; padding: 0px; color: #000000; font-family: Calibri, sans-serif; font-size: 14.666666984558105px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 17px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: inherit;"><span class="Apple-converted-space">&nbsp;</span>is an account, a computer with internet access, and a desire to learn!</span></p>	0
