1	terms_and_conditions_student		<p>Relating to the use of the wizoku Website and any Services provided by wizoku.</p>\r\n<h3><strong>1. Interpretation</strong></h3>\r\n<p>The definitions in this clause apply to these Terms.</p>\r\n<p>Headings do not affect the interpretation of these Terms.</p>\r\n<p><strong>Cooling Off Period:</strong> the period of 7 working days commencing on the day after the date of creation of a binding contract between You and wizoku in accordance with clause 11.1.</p>\r\n<p><strong>Contract: </strong>means a Contract between You and Us as set out in clause 9 of these Terms.</p>\r\n<p><strong>Initial Session: </strong>In respect of a Tutor Session that has been booked for a time period of 30 minutes the Initial Session is a five minute period, for a Tutor Session that has been booked for a time period in excess of 30 minutes then the Initial Session is a ten minute period which the Tutor provides at no cost to the Student. After the Initial Session has lapsed the You can decide whether to proceed with the Session by confirming by ticking the pop up box if You decide to proceed then the session will become chargeable.<strong>&nbsp;</strong></p>\r\n<p><strong>Privacy Policy</strong>: means the wizoku privacy policy from time to time in force (<a href="/privacy-policy/">http://universaltutors.com/privacy-policy/</a>).</p>\r\n<p><strong>Service</strong>: the provision of online tutoring and support for Students including but not limited to the provision of online Tutors, Virtual Classrooms,enabling software and general website functionality accessed via the wizoku Website. The Site allows independent Tutors to advertise their tutoring services to you. You can book a tuition session with the Tutor you have chosen through the website. For the avoidance of doubt all Tutors and self employed and wizoku accepts no responsibility for any Tutor nor any service provided by them.&nbsp;</p>\r\n<p><strong>Student:</strong> means you or a minor on whose behalf you are contracting.</p>\r\n<p><strong>Student Accoun</strong>t: an account which is created by You and holds all Student information, content and resources and can be accessed by You via Your Account and by using your unique username and password.</p>\r\n<p><strong>Terms:</strong> these terms and conditions and any other document or policy referred to in these terms and conditions.</p>\r\n<p><strong>Tuition Session</strong>: means a pre-booked tutorial with a Tutor in a Virtual Classroom which shall be for a minimum of 30 minutes and there after for time periods of 15 minutes.</p>\r\n<p><strong>Tutor</strong>: a self-employed tutor who is registered on the Website who provides online tuition to Students via the Website.</p>\r\n<p><strong>Wizoku:</strong> www.universaltutors.com and <strong>we</strong>, <strong>our</strong> or <strong>us</strong>. References to wizoku in these Terms shall be deemed to be a reference to Minerva Education Limited whose registered office is c/o Shelley Stock Hutter, 1<sup>st</sup> Floor, 7-10 Chandos Street, London, W1G 9DQ.</p>\r\n<p><strong>User Content</strong>: content (including without limitation materials, information, communications and ideas) in any format which is communicated, uploaded or otherwise transmitted or posted by You to the website by any means.&nbsp;</p>\r\n<p><strong>Virtual Classroom</strong>: the live internet broadcast within the Website where You and the Tutor meet at a pre-arranged time to take part in a private Tuition Session.</p>\r\n<p><strong>Website: www.universaltutors.com </strong>and any software or content which is available for download from the Website.</p>\r\n<p><strong>WebSite Content</strong>: all other information contained in or published on the wizoku website other than information communicated, uploaded, transmitted or published by You.</p>\r\n<p><strong>You</strong>: the Student or the person (including a minor) on whose behalf you are contracting.</p>\r\n<p><strong>Your Account</strong>: means the Student Account.</p>\r\n<p>1.1 All and any business undertaken by wizoku and You is transacted subject to these Terms. In the event of any conflict between these Terms and any other terms and conditions, these Terms shall prevail unless expressly otherwise agreed in writing by us. No variation of these Terms shall be valid if made without the written consent of wizoku. These Terms shall supersede any previous Terms.</p>\r\n<p>1.2 Offer and acceptance: By clicking the acceptances box, we accept your offer and at which point and on which date the Contact shall come into existence. If you are a parent, guardian, or other person contracting on behalf of a minor to access the Service, you confirm and represent that you have the authority to do so and agree to be primarily liable for any liability whatsoever arising from the acts or omissions of such minor.</p>\r\n<h3><strong>2. The Service</strong></h3>\r\n<p>2.1 Through the Website and using the Service, Students can connect with independent, self-employed Tutors who provide Tuition Sessions in Virtual Classrooms. The Service includes, without limitation, the provision of:</p>\r\n<p>2.1.1 the opportunity to review profiles of tutors in a number of different subjects; and</p>\r\n<p>2.1.2 to contract with a Tutor who will provide online tuition by a Tutor in a Virtual Classroom;</p>\r\n<p>2.1.2.1 You are solely responsible for all service, telephony and/or other fees and costs associated with Your access to and use of the Service; for obtaining and maintaining all telephone, computer hardware and other equipment required for such access and use; and for procuring, maintaining and paying for the latest available version of security software to protect against the transmission of viruses and other computer malware during Your access to and use of the Service.&nbsp;</p>\r\n<p>2.2 As an online service wizoku may periodically be unavailable as we perform regular maintenance and upgrades. Where reasonably possible, these activities shall be notified to You by posting any such changes on the Website. However, wizoku makes no warranty, guarantee or representation as to, and accepts no liability for, the availability or suitability of the Website and/or the Service</p>\r\n<p>2.3 wizoku may vary the Services at any time (including but not limited to) to:-</p>\r\n<p>a) comply with any legal, statutory or regulatory requirements;</p>\r\n<p>b) change the fees payable in respect of the Services;</p>\r\n<p>c) withdraw any Service Features;</p>\r\n<p>d) maintain the integrity of security of the Services.</p>\r\n<h3><strong>3. Registration</strong></h3>\r\n<p>To use the Service, You will need to:-</p>\r\n<p>a) register on the Website and set up an account with a username and password (the&nbsp;information provided by You will be stored and used in accordance with the <a href="/privacy-policy/">Privacy Policy</a>;&nbsp;</p>\r\n<p>b) pay the fees in accordance with clause 4 in order to take a Tuition Session; &nbsp;</p>\r\n<h3><strong>4. Payment</strong></h3>\r\n<p>4.1 When booking a Tuition Session you accept the fees for the Tuition Session advised to you in writing by the Tutor (<strong>Fees</strong>);&nbsp;</p>\r\n<p>4.2 For the avoidance of doubt the Fee charged by the Tutor to You for a Tuition Session will not be less than &pound;5 for a 30 minute Tuition Session and there after &pound;2.50 per 15 minutes.</p>\r\n<p>4.3 You shall make payment, in accordance with the instructions on the Website, for any Tuition Sessions or other products and services offered by wizoku in advance of the Services or products being provided.&nbsp;</p>\r\n<p>4.4 Twenty percent (20%) of Fees paid shall be to Us in respect of the provision of the Virtual Classroom, access to the Website and the remainder is the fee you agree to pay to the Tutor.</p>\r\n<p>4.5 wizoku reserves the right to make changes to the Fees at any time and any such changes shall immediately become effective once posted on the Website unless a booking was made prior to the change in which case the fees for that Tuition Session shall be charged the fees as advised to you in writing by the Tutor at the time of booking.&nbsp;</p>\r\n<h3><strong>5. Tuition Session Monitoring and Recordings</strong></h3>\r\n<p>5.1 Wizoku may record all or any part of a Tuition Session for quality control and other purposes and reserves its rights to review the Tuition Session for any purpose. &nbsp;&nbsp;</p>\r\n<p>5.2 However Wizoku are under no obligation to oversee, monitor or moderate any interactive service provided on the Website including the Virtual Classroom, instant messaging and private messaging. and we expressly exclude our liability for any loss or damage arising from the use of any interactive service by a user in contravention of our Terms, whether the service is monitored or not.</p>\r\n<p>5.3 The use of any of our interactive services (including the Virtual Classroom) by a minor is subject to the consent of their parent or guardian. In this situation the parent or guardian hereby agrees to monitor any use of an interactive service by the minor.&nbsp;</p>\r\n<p>5.4 By entering into these Terms You agree that Wizoku own all transcripts and recordings of Tuition Sessions and all comments that You may provide to us on or through the Website, the Services or any other means, such as part of user satisfaction or other similar surveys. You hereby agree (where appropriate by way of present assignment of future rights) to assign to Wizoku all and/or any rights you may have in any such transcripts and comments.</p>\r\n<p>5.5 Your Tuition Session shall be recorded and the recorded audio, IM and white board activity (but not video) shall be stored in yours and the Tutors account for a minimum period of 3 months. If you access the recording at any time the 3 month period will be extended for a further 3 month period. The time can be extended an unlimited amount of times but this is subject to the sole discretion of Wizoku.&nbsp;</p>\r\n<h3><strong>6. Initial Tutor Sessions</strong></h3>\r\n<p>6.1 You will be entitled to an Initial Session with a Tutor which will not be charged to You if You decide not to proceed with the Tuition Session.</p>\r\n<p>6.2 Once the Initial Session has lapsed a pop up box will appear on the screen if you tick it to confirm you wish to proceed then the Tuition Session will proceed and the Tuition Session will become chargeable in full.</p>\r\n<h3><strong>7. Links to other Websites and Services</strong></h3>\r\n<p>7.1 Where the Website contains links to other sites and resources provided by third parties, these links are provided for your information only. Wizoku have no control over the contents of those sites or resources and accept no responsibility for them or for any loss or damage that may arise from your use of them.</p>\r\n<p>7.2 Any concerns regarding such links should be emailed to <a href="mailto:support@universaltutors.com">support@universaltutors.com</a>.</p>\r\n<h3><strong>8. CRB Checks&nbsp;</strong></h3>\r\n<p>All Tutors registered with Us will be required to have a valid CRB Check from the date that they register with Us.</p>\r\n<h3><strong>9. Conduct in respect of the Website and the Services</strong></h3>\r\n<p>9.1 You may only use and access the Website and use the Services for lawful purposes; and You are prohibited from posting or transmitting to or from the Website any material that it threatening, defamatory, obscene, indecent, seditious, offensive, pornographic, abusive, liable to incite racial hatred, discriminatory, menacing, scandalous, inflammatory, blasphemous, in breach of confidence, in breach of privacy or which may cause annoyance or inconvenience; or</p>\r\n<p>a) for which you have not obtained all necessary licences and / or approvals; or</p>\r\n<p>b) for the any purpose which attempts to or does&nbsp; harm minors in any way; or</p>\r\n<p>c) which constitutes or encourages conduct that would be considered to be a criminal offence, give rise to a civil liability, or otherwise be contrary to the law of or infringe the rights of any third party, in any country in the world; or</p>\r\n<p>d) which is technically harmful (including without limitation, computer viruses, logic bombs, Trojan horses, worms, harmful components, corrupted date or other malicious software or harmful data).</p>\r\n<p>9.2 You must not misuse the Website (including, without limitation, by hacking).</p>\r\n<p>9.3 We shall fully co-operate with any law enforcement authorities or court order requesting or directing us to disclose the identity or locate anyone posting any material in breach of clauses 8.1 and 8.2.</p>\r\n<p>9.4 You agree that you:-</p>\r\n<p>a) shall treat the Tutors with respect and not use obscenities in the Virtual Classroom, make threats, or discuss matters other than those directly related to the academic subject for which You seek help; and</p>\r\n<p>b) shall not disclose any information to a Tutor that could be considered personally identifiable information including Your full name, address, telephone number, email address, national insurance number, password or any other information that could be used&nbsp; to identify or locate You. A violation of this agreement may lead to a suspension of Your Account; and&nbsp;</p>\r\n<p>c) will not request, solicit or attempt to solicit any such information from any Tutor and if any Tutor does disclose any such information or suggests any meeting or conversation not through the Website you will immediately report this to Wizoku.</p>\r\n<p>d) You acknowledge that we may screen User Content, and that we shall have the right (but not the obligation), in our sole discretion, to remove any User Content. We may terminate any Tuition Session where we consider, in our sole discretion, that a user is uploading or otherwise transmitting inappropriate content. Without limiting the foregoing, we have the right to remove any User Content that violates these Terms or is otherwise, in Wizoku's sole opinion, objectionable.&nbsp;</p>\r\n<h3><strong>10. Formation of contract:</strong></h3>\r\n<p>A contract between Wizoku and you will be formed when:-&nbsp;</p>\r\n<p>a) You register or have already registered on the Website;&nbsp; and</p>\r\n<p>c) We have contacted you to confirm registration was successful. From this point the contact between us will be binding.</p>\r\n<h3><strong>11. Confidential Information</strong></h3>\r\n<p>Whilst accessing the Website you will have access to Website Content and information provided during the Services (<strong>Information</strong>) You confirm that you will not without Universal Tutor's prior written approval use or disclose this information to any person other than in accordance with these Terms.&nbsp;</p>\r\n<h3><strong>12. Termination</strong></h3>\r\n<p>12.1 We may terminate the Contract in accordance with these Terms at any time by providing You with notice of such termination, which shall be effective immediately upon notification to You.</p>\r\n<p>12.2 We may terminate these Terms immediately without notice for any breach by You of these Terms or any policies referred to in these Terms, as posted on the website from time.</p>\r\n<p>12.3 You shall be entitled to terminate the session at any time up to 5 minutes into the Session (Initial Period) unless you do not turn up for the Initial Period in which case you will be charged in full for the booked session.</p>\r\n<p>12.4 Termination will not affect our outstanding rights, including our right to recover from you any money you owe us under these Terms.&nbsp;</p>\r\n<p>12.5 These clauses shall continue in force following the termination or expiration of these Terms, 11 Dispute Resolution, 10 Confidentiality, 8 Conduct, 13 Limitation of Liability, 12 Indemnification and 16 Jurisdiction.<strong><em>&nbsp;</em></strong></p>\r\n<p>12.6 You agree that upon the termination of these Terms, we may block access by you to the Website and prevent You from using the Services.&nbsp;</p>\r\n<p>12.7 Upon the termination of these Terms You will immediately destroy any downloaded, printed or otherwise stored Website Content.</p>\r\n<h3><strong>13. Indemnification</strong></h3>\r\n<p>13.1 You agree to indemnify and to hold Wizoku harmless in full immediately on demand, against all claims, liability, damages, costs and expenses, including legal fees on an indemnity basis, arising out of:</p>\r\n<p>13.1.1 any breach of these Terms</p>\r\n<p>13.1.2 the infringement of any intellectual property or other right of any person or entity, or</p>\r\n<p>13.1.3 any other liabilities arising out of the use of or access to the website and Service by You or by any other person using Your computer, Your password and/or Your log in details.</p>\r\n<h3><strong>14. Limitation of Liability - YOUR ATTENTION IS PARTICULARILY DRAWN TO THIS CLAUSE</strong></h3>\r\n<p>14.1 Nothing in these Terms shall limit our liability to you for:-</p>\r\n<p>a) death or personal injury caused by our negligence; or</p>\r\n<p>b) fraud or fraudulent misrepresentation.</p>\r\n<p>14.2 Subject to clause 13.2 we shall under no circumstances whatsoever be liable to you (whether in contract, tort (including negligence) breach of statutory duty or otherwise for any loss of profit or any indirect or consequential loss arising under or in connection with the Contract; and</p>\r\n<p>14.3 Our total liability to You in respect of all other losses arising under or in connection with the Contract whether in contract, tort (including negligence) breach of statutory duty or otherwise shall in no circumstances exceed the amount paid by You to us in any one year period or if you contracted with us les than one year from the date of the claim then the amount shall be limited to the amount paid by You to Us during that period.</p>\r\n<h3><strong>15. No Waiver</strong></h3>\r\n<p>No waiver by Wizoku shall be construed as a waiver of any preceding or subsequent breach of any provision. Wizoku's failure to exercise or enforce any right or provision of these Terms shall not constitute a waiver of such right or provision unless acknowledged and agreed to by wizoku&nbsp; in writing.</p>\r\n<h3><strong>16. Entire Agreement</strong></h3>\r\n<p>These Terms constitute the entire agreement between us and supersedes any previous agreement between us.</p>\r\n<h3><strong>17. Jurisdiction&nbsp;</strong></h3>\r\n<p>These Terms shall be governed by English law and both parties agree to submit to the exclusive jurisdiction of the English Courts.&nbsp;</p>\r\n<h3><strong>18. Assignment&nbsp;</strong></h3>\r\n<p>18.1 Wizoku may transfer, assign or subcontract Our rights and obligations under these Terms to any other party without notice to you.</p>\r\n<p>18.2 You may not transfer, assign or subcontract any of your rights and obligations under these Terms other than in accordance with these Terms or if previously agreed by us in writing.&nbsp;</p>\r\n<h3><strong>19. Third party rights</strong></h3>\r\n<p>Save in respect of a&nbsp; minor whose parent or guardian has contracted on their behalf, a person who is not a party to this Agreement shall not have any rights under or in connection with it.</p>\r\n<h3><strong>20. No partnership or agency</strong></h3>\r\n<p>Nothing in this Agreement is intended to, or shall be deemed to, constitute a partnership or joint venture of any kind between any of the parties, nor constitute any party the agent of another party for any purpose unless expressly provided in these terms and conditions.</p>\r\n<h3><strong>21. Force majeure</strong></h3>\r\n<p>Wizoku shall not be in breach of these Terms nor liable for delay in performing, or failure to perform, any of its obligations under this agreement if such delay or failure result from events, circumstances or causes beyond its reasonable control.&nbsp;In such circumstances&nbsp;wizoku shall be entitled to a reasonable extension of the time for performing such obligations, provided that if the period of delay or non-performance continues for 14 days, you may terminate the Contract by giving 7 days written notice to wizoku.&nbsp;</p>\r\n<h3><strong>22. Severability</strong></h3>\r\n<p>If any provision of this Agreement may prove to be invalid or unenforceable in any way, the other provisions of this Agreement and the remainder of the provision in question shall remain in full force and effect.</p>\r\n<h3><strong>23. Cancellation&nbsp;</strong></h3>\r\n<p>You shall be entitled to terminate a Tuition Session at any time up to 5 minutes into the Session (Initial period) unless you do not turn up for the Session in which case you will be liable for the entire booked Session.&nbsp;</p>\r\n<h3><strong>24. Data Protection&nbsp;</strong></h3>\r\n<p>24.1 You will provide us with certain data and personal information in accordance with these Terms. You agree that we shall be entitled to use any data provided by you in accordance with Our <a href="/privacy-policy/">Privacy policy</a>.</p>\r\n<p>24.2 We confirm that we shall comply with all relevant UK Data protection rules, regulations and legislation as in force from time to time.</p>\r\n<p>24.3 We will use the personal information you provide to Us to:</p>\r\n<p>(a) provide the Services;</p>\r\n<p>(b) process your payment for such Services; and</p>\r\n<p>(c) inform you about similar products or services that we provide, but you may stop receiving these at any time by contacting Us.</p>\r\n<p>24.4 You agree that We may pass your personal information to the Police or any government authority if requested by them in investigating any illegal activity or to provide information to them concerning any activity carried out by You whilst contracted under these Terms, or if compelled to do so by law or if in our opinion it may protect third party. &nbsp;</p>\r\n<p>24.5 Under The Data Protection Act 1998 you have the right to gain access to all of the confidential personal data that We may hold about you. If you wish to have access to this please contact us <a href="mailto:support@universaltutors.com">support@wizoku.com</a>.</p>\r\n<p>24.6 If you have not had an active account within 7 years we may destroy all information we hold regarding You.&nbsp;</p>\r\n<p>24.7 We will not give your personal data to any other third party other than in accordance with this clause 22.</p>\r\n<h3><strong>25. Complaints Process &amp; Dispute Resolution</strong></h3>\r\n<p>If you have any complaints please email us on <a href="mailto:support@universaltutors.com">support@wizoku.com</a> and we will endeavour to respond to you within 24 hours to confirm how we will deal with this issue.</p>\r\n<h4><strong>25.1. DISPUTES INVOLVING TUTORS</strong></h4>\r\n<p>25.1.1 If at any time you become dissatisfied with any service provided to You by a Tutor or have any complaint generally you must immediately notify Us by telephone and by email <a href="mailto:support@universaltutors.com">support@wizoku.com</a>.</p>\r\n<p>25.1.2 Should We require any information or documentation from you regarding any complaint or dispute as set out above You must immediately provide this to us.</p>\r\n<p>25.1.3 You hereby confirm that you will cooperate fully with Us in any attempts to resolve any complaint or dispute.</p>\r\n<p>25.1.4 Should any dispute or complaint against You arise we reserve Our right to immediately suspend your Account until such time as any issue is resolved. We reserve Our right to continue to suspend your Account whilst we carry out any investigation which in Our sole opinion is necessary.</p>\r\n<h4><strong>25.2 DISPUTES BETWEEN US</strong></h4>\r\n<p>25.2.1 If any dispute between us arises other than in accordance with clause 23.1 Us and You shall first attempt to settle the dispute amongst ourselves if we cannot resolve any issue within 7 days of either party being notified in writing of the dispute with sufficient detail to be able to consider it then the parties will attempt to settle it by mediation in accordance with the Centre for Effective&nbsp;Dispute Resolution&nbsp;(CEDR) Model Mediation Procedure.&nbsp;</p>\r\n<p>25.2.2 Unless otherwise agreed between the parties, the mediator will be nominated by CEDR. To initiate the mediation a party must give notice in writing ("ADR notice") to the other party to the&nbsp;dispute&nbsp;requesting a mediation. A copy of the request should be sent to CEDR. The mediation will start not later than 28 days after the date of the ADR notice. No party may commence any court proceedings in relation to any&nbsp;dispute&nbsp;arising out of this agreement until it has attempted to settle the&nbsp;dispute&nbsp;by mediation and either the mediation has terminated or the other party has failed to participate in the mediation, provided that the right to issue proceedings is not prejudiced by a delay.</p>
2	terms_and_conditions_tutor		<h3><strong>Background</strong></h3>\r\n<p>Wizoku have agreed to provide a platform to connect tutors with students and provide the facilities for them to engage in online tutoring sessions.</p>\r\n<p>You must ensure that you have reviewed these Tutor Terms (as defined below) in respect of your provision of services as a tutor, in detail and ensure that you understand them and agree to them before ticking the box below to confirm your acceptance. You will then need to complete a registration form to be sent to us.&nbsp;</p>\r\n<p><strong>Us, We, Our&nbsp;</strong>means wizoku and / or Minerva Education Limited whose registered office is c/o Shelley Stock Hutter LLP, 1<sup>st</sup>&nbsp;Floor, 7-10 Chandos Street, London, W1G 9DQ.</p>\r\n<p><strong>You</strong>:&nbsp; you as a tutor with the necessary qualifications and experience to provide online tuition services.</p>\r\n<h3><strong>1. Definitions&nbsp;</strong></h3>\r\n<p>1.1 When the following words with capital letters are used in these Terms, this is what they will mean:</p>\r\n<p><strong>Abus</strong>e: this means but is not limited to the breach of these Tutor Terms and the use of&nbsp; the Site in any which in Our opinion is unreasonable. &nbsp;</p>\r\n<p><strong>Code of Conduct:&nbsp;</strong>The&nbsp;<a href="/code-of-conduct/" target="_blank">Code of Conduct</a>&nbsp;that the Tutors agree to abide by set out in the Schedule attached to these Terms.</p>\r\n<p><strong>Confidential Information</strong>: any information provided by Us to You including but not limited to any information relating to a Student including their personal information, any information regarding Us, any Site log in information any information which could reasonably be considered to be confidential in nature.&nbsp; &nbsp;</p>\r\n<p><strong>Contract</strong>: the time period during which you will provide online tuition services to a Student as agreed between You and the Student via the Site.&nbsp;</p>\r\n<p><strong>Fee:&nbsp;</strong>The fee set by you and notified to us in writing and agreed with the Student in advance for each Tutor Session. The fee for a Tutor Session shall not be less that &pound;10 for a 30 minute Tutor Session and there after &pound;5 per 15 minutes.</p>\r\n<p><strong>Initial Session,</strong>&nbsp;In respect of a Tutor Session that has been booked for a time period of 30 minutes the Initial Session is a five minute period, for a Tutor Session that has been booked for a time period in excess of 30 minutes then the Initial Session is a ten minute period which You agree to provide at no cost to the Student. After the Initial Session has lapsed the Student can decide whether to proceed with the Session by confirming by ticking the pop up box if they decide to proceed then the session will become chargeable.&nbsp;</p>\r\n<p><strong>Paypal Account:&nbsp;</strong>your nominated paypal account into which payment for the services provided by you can be paid.&nbsp;<strong>&nbsp;</strong></p>\r\n<p><strong>Student</strong>&nbsp;a third party (or if they are a minor their parent or guardian) who has entered into a contract with Us for the provision of online tuition services by You.</p>\r\n<p><strong>Tutor:&nbsp;</strong>this is a tutor who has registered with Us and has received confirmation from Us in writing (to include email) that their Account has been activated and they will be eligible to provide tutoring services through the Site .</p>\r\n<p><strong>Tutor Account:&nbsp;</strong>the Account set up in Your name where all material uploaded to the virtual classroom will be saved and be accessible by You or Us for a minimum of 3 months following completion of the Session in question. This includes (a non-exhaustive list) a recording of the Session to include Instant Messaging, audio and whiteboard activity but not video. (If the Account is accessed at any time during this 3 month period it shall remain active for a further 3 months (the Account can be re-set unlimited times, at the discretion of wizoku).</p>\r\n<p><strong>Tutor Session:&nbsp;</strong>a Tutor Session is the period when you are providing tutoring services to the Student. Each Session shall last for a minimum of two periods (each period is 15 minutes). Other than the required minimum You and the Student can agree the length of the Tutor Session but the session must be in a multiple of 15 minutes.</p>\r\n<p><strong>Tutor Terms:</strong>&nbsp;these terms and conditions and any policies referred to therein. &nbsp; &nbsp;</p>\r\n<p><strong>Site:</strong>&nbsp;<a href="/">www.wizoku.com</a>&nbsp;</p>\r\n<p>1.2 When We use the words "writing" or "written" in these Terms, this will include e-mail unless We say otherwise.</p>\r\n<p>1.3 Clause headings are for ease of reference only and are not intended to form part of to in any way to affect the meaning, interpretation of these Tutor Terms.</p>\r\n<p>1.4 A person includes a natural person, a corporate or unincorporated body (whether or not having a separate legal personality). Unless context otherwise requires, words in the singular include the plural and in the plural include the singular. Unless the context otherwise requires, a reference to one gender includes a reference to the other genders.</p>\r\n<p>1.5 A reference to a particular statute, statutory provision or subordinate legislation is a reference to it as it is in force from time to time taking account of any amendment or re-enactment and includes any statute, statutory provision or subordinate legislation which it amends or re-enacts and subordinate legislation for the time being in force made under it.</p>\r\n<p>1.6 Where the words&nbsp;<strong>include(s)</strong>,&nbsp;<strong>including&nbsp;</strong>or&nbsp;<strong>in particular</strong>&nbsp;are used in these Tutor Terms, they are deemed to have the words "without limitation" following them.</p>\r\n<p>1.7 Any obligation in these Tutor Terms on a person not to do something includes an obligation not to agree or allow that thing to be done.</p>\r\n<p>1.8 Where the context permits,&nbsp;<strong>other</strong>&nbsp;and&nbsp;<strong>otherwise</strong>&nbsp;are illustrative and shall not limit the sense of the words preceding them.</p>\r\n<h3><strong>2. Registration</strong></h3>\r\n<p>You must register on the Site by<strong>&nbsp;<a href="/account/signup/tutor/">http://wizoku.com/account/signup/tutor/</a></strong></p>\r\n<h3><strong>3. Acceptance by wizoku</strong></h3>\r\n<p>We will notify You by email if your registration has been accepted and confirm that your Account is now live and can be accessed by you.</p>\r\n<h3><strong>4. Providing online Tutoring services and compliance with wizoku requirements&nbsp;</strong></h3>\r\n<p>You confirm that you will comply with all of our policies including the&nbsp;<a href="/code-of-conduct/" target="_blank">Code of Conduct</a>&nbsp;(set out in the schedule to these Terms) and these Terms themselves.</p>\r\n<h3><strong>5. If there is a problem with the services</strong></h3>\r\n<p>5.1 In the unlikely event that there is any defect with the Services&nbsp;</p>\r\n<p>a) please contact Us and tell Us as soon as reasonably possible;</p>\r\n<p>b) please give Us a reasonable opportunity to repair or fix any defect; and</p>\r\n<p>c) We will use every effort to repair or fix the defect as reasonably practicable and, in any event, within 7 days.&nbsp;You will not have to pay for Us to repair or fix a defect with the Services under this clause 5.1.</p>\r\n<p>5.2 As a consumer, you have legal rights in relation to Services not carried out with reasonable skill and care, or if the materials We use are faulty or not as described. Advice about your legal rights is available from your local Citizens' Advice Bureau or Trading Standards office. Nothing in these Terms will affect these legal rights.</p>\r\n<h3><strong>6. Employment status&nbsp;</strong></h3>\r\n<p>6.1 You confirm that the relationship between You and Us will be that of independent contractor and nothing in these Tutor Terms will render You an employee, worker, agent or partner of Us and You shall not hold yourself out as such.</p>\r\n<p>6.2 As an independent contractor you confirm that you are self employed under these Tutor Terms and that You are solely responsible to HMRC (or the equivalent tax body in the jurisdiction where you are domiciled) for all and any matters relating to tax including income tax, Vat, National Insurance contributions (or the equivalent if you are not domiciled in the UK for tax purposes).</p>\r\n<p>6.3 You shall contract directly with the Student through the Site.</p>\r\n<p>6.4 You must ensure that you keep a complete and up to date record of all and any payments made to you to enable you to complete your annual tax returns and to comply with any relevant legislation.</p>\r\n<p>6.5 In accordance with paragraphs 6.1 - 6.3 above you are fully responsible and shall fully indemnify Us for and in respect of:-</p>\r\n<p>a) any income tax, National Insurance and social security contributions and any other liability, deduction, contribution, assessment or claim arising from or made in connection with any performance of any services in accordance with these Tutor Terms, where the recovery is not prohibited by law.&nbsp;</p>\r\n<p>b) You shall further indemnify Us against all reasonable costs, expenses and any penalty, fine or interest incurred or payable by Us in connection with or in consequence of any such liability, deduction, contribution, assessment or claim;</p>\r\n<p>c) any liability arising from any employment-related claim or any claim based on worker status (including reasonable costs and expenses) brought by You against Us arising out of or in connection with the provision of any services provided under these Tutor Terms.</p>\r\n<p>6.6 The Client may at its option satisfy such indemnity (in whole or in part) by way of deduction from any payments due to the Tutor.</p>\r\n<p>6.7 We may at our option satisfy such indemnity (in whole or in part) by way of deduction from any payments due to it in accordance with these Tutor Terms.</p>\r\n<p>6.8 We are not obligated to introduce any Student to You and You are not obligated to accept any Student introduced by Us. All Tutor Sessions are booked through the Site's booking system. If you after consideration take the decision not to accept a particular Student this will not preclude you from being offered further introductions by Us. &nbsp;</p>\r\n<h3><strong>7. Fees</strong></h3>\r\n<p>7.1 Wizoku shall send any fees that you are due (<strong>Fees</strong>) directly to your Paypal Account on a monthly basis on 1<sup>st</sup>&nbsp;of month or nearest business day.&nbsp;</p>\r\n<p>7.2 You shall be entitled to withdraw any funds from your Account at any time but you will be required to pay an administrative fee of 3.4% of the total plus &pound;0.20 or $0.30 or &euro;0.30 to Paypal each time you withdraw funds from your Account.</p>\r\n<p>7.3 You shall be entitled to set the fee for any Tutor Session and agree the same with the Student. The fee paid to you will be the amount agreed and notified to us for each Tutor Session you complete, less 20% which shall be retained by Us in respect of our fee for allowing you to utilise the Site and to meet Students and potential Students through the Site.&nbsp;</p>\r\n<p>7.4 You agree that We will keep records as to how many Tutor Sessions you complete and the Fees will be paid accordingly.&nbsp;</p>\r\n<h3><strong>8. Dispute resolution</strong></h3>\r\n<h4><strong>8.1 DISPUTES INVOLVING STUDENTS</strong></h4>\r\n<p>a) If at any time you are aware of any Student having any dispute with Us, or becoming dissatisfied with any service provided to them by You or having any complaint generally you must immediately notify Us by telephone and by email&nbsp;<a href="mailto:support@universaltutors.com">support@wizoku.com</a>.</p>\r\n<p>b) Should We require any information or documentation from you regarding any complaint or dispute as set out above You must immediately provide this to us.</p>\r\n<p>c) You hereby confirm that you will cooperate fully with Us in any attempts to resolve any complaint or dispute.</p>\r\n<p>d) Should any dispute or complaint against You arise we reserve Our right to immediately suspend your Tutor Account until such time as any issue is resolved. We reserve Our right to continue to suspend your Tutor Account whilst we carry out any investigation which in Our sole opinion is necessary.</p>\r\n<p>e) We reserve the right to withhold payment of Fees to You until any dispute or complaint has been resolved.</p>\r\n<p>f) If We issue any Student with a refund for any sums paid in relation to any Tuition Session with You, as a result of You breaching these Tutor Terms&nbsp; or we make an error in respect of any payment of Fees, you shall immediately refund to us the fee you have received in respect of any such session. We reserve the right to deduct any such amount from any future Fees to be paid to you.&nbsp;<strong><em>&nbsp;</em></strong></p>\r\n<h4><strong>8.2 DISPUTES BETWEEN US</strong></h4>\r\n<p>a) If any dispute between us arises other than in accordance with clause 8.1 Us and You shall first attempt to settle the dispute amongst ourselves if we cannot resolve any issue within 7 days of either party being notified in writing of the dispute with sufficient detail to be able to consider it then the parties will attempt to settle it by mediation in accordance with the Centre for Effective&nbsp;Dispute Resolution&nbsp;(<strong>CEDR</strong>) Model Mediation Procedure.&nbsp;</p>\r\n<p>b) Unless otherwise agreed between the parties, the mediator will be nominated by CEDR. To initiate the mediation a party must give notice in writing ("ADR notice") to the other party to the&nbsp;dispute&nbsp;requesting a mediation. A copy of the request should be sent to CEDR. The mediation will start not later than 28 days after the date of the ADR notice. No party may commence any court proceedings in relation to any&nbsp;dispute&nbsp;arising out of this agreement until it has attempted to settle the&nbsp;dispute&nbsp;by mediation and either the mediation has terminated or the other party has failed to participate in the mediation, provided that the right to issue proceedings is not prejudiced by a delay.</p>\r\n<h3><strong>9. Tutor Session&nbsp;</strong></h3>\r\n<p>9.1 If You accept a Student and agree to provide them with online Tutoring in accordance with these Tutor Terms You accept that a Tutor Session shall be recorded and may be cancelled by either You or the Student at any time prior to the Tutor Session commencing.&nbsp;</p>\r\n<p>9.2 You must provide each Student with 5 minutes of online Tutoring at no cost (if the Tutor Session is for a period of 30 minutes) or with 10 minutes of online Tutoring at no costs if the Tutor Session is for a period in excess of 30 minutes), if after the applicable 5 or 10 minutes either You or the Student decides that they do not wish to continue they or You may cancel the Tutor Session and no charge will be made. However if the Tutor Session continues past the Initial Period then the Student will be obligated to pay for an entire Tutor Session. However for the avoidance of doubt if you leave before the end of a Tutor Session it is at wizoku's sole discretion whether a class has been completed or not.</p>\r\n<p>9.3 Should You wish to cancel a Tuition Session you must do so by clicking on the "Cancel Class" button in your Account. If possible You should provide a reason for cancellation. If a Student cancels it is their responsibility to notify us.</p>\r\n<p>9.4 Student is only obligated to pay for a Tutor Session which has completed (unless the Student cancels or leaves the Session early and no dispute is raised).&nbsp;</p>\r\n<p>9.5 If you fail to attend any pre arranged Tutor Session without cancelling in accordance with clause 9.3 We may at our sole discretion cancel any agreement between Us and You under these Tutor Terms.&nbsp;</p>\r\n<p>9.6 If a Student fails to attend a Tutor Session or if they leave a Tutor Session after the have confirmed they wish to continue past the Initial Period then they will be charged in full for the Tutor Session.</p>\r\n<h3><strong>10. Confidentiality</strong></h3>\r\n<p>10.1 You undertake to Us to keep confidential any information that you have acquired about Us or any Student introduced by us to You and to use any information that you have acquired only for the purposes contemplated by these Tutor Terms.</p>\r\n<p>10.2 You do not have to keep confidential or to restrict Your use of&nbsp;</p>\r\n<p>a) information that is or becomes public knowledge other than as a direct or indirect breach of any terms of these Tutor Terms; or</p>\r\n<p>b) any information that you are required by law or any regulatory body (including any taxation authority) or legislation to disclose;</p>\r\n<p>c) any information that we provide you with our written consent that you can disclose.</p>\r\n<h3><strong>11. Intellectual property rights</strong></h3>\r\n<p>11.1 You acknowledge that whilst providing Tutor Session We have the right to record these both for our own purposes and for those of the students.</p>\r\n<p>11.2 You hereby agree and accept that We shall be entitled to record, store and use the recordings in anyway We see fit.</p>\r\n<p>11.3 You agree that You will not breach any third party intellectual property rights in any way whilst providing any services under these Tutor Terms, including but not limited to using any copyrighted material without the necessary consent or license or uploading to the Site any such copyrighted information or documentation.</p>\r\n<p>11.4 Should you upload any materials to the Site you confirm that you grant to Us an irrevocable non-exclusive licence to use these materials.&nbsp;</p>\r\n<p>11.5 You have no right to use, modify, copy or distribute, adapt or alter or in any way deal with any intellectual property owned by Us without our prior written approval. For the avoidance of doubt this includes any software used by us, content on the Site and our name.&nbsp;</p>\r\n<h3><strong>12. Events Outside Our Control</strong></h3>\r\n<p>12.1 We will not be liable or responsible for any failure to perform, or delay in performance of, any of Our obligations under these Tutor Terms that is caused by an Event Outside Our Control.&nbsp;</p>\r\n<p>12.2 An Event Outside Our Control means any act or event beyond Our reasonable control, including without limitation strikes, lock-outs or other industrial action by third parties, civil commotion, riot, invasion, terrorist attack or threat of terrorist attack, war (whether declared or not) or threat or preparation for war, fire, explosion, storm, flood, earthquake, subsidence, epidemic or other natural disaster, or failure of public or private telecommunications networks.</p>\r\n<p>12.3 If an Event Outside Our Control takes place that affects the performance of Our obligations under these Tutor Terms:&nbsp;</p>\r\n<p>a) We will contact you as soon as reasonably possible to notify you; and</p>\r\n<p>b) Our obligations under these Tutor Terms will be suspended and the time for performance of Our obligations will be extended for the duration of the Event Outside Our Control. Where the Event Outside Our Control affects Our performance of Services to you, We will restart the Services as soon as reasonably possible after the Event Outside Our Control is over.</p>\r\n<p>12.4 You may cancel the contract if an Event Outside Our Control takes place.&nbsp;</p>\r\n<h3><strong>13. Our termination rights</strong></h3>\r\n<p>13.1 We reserve the right to terminate any agreement with you in accordance with these Tutor Terms immediately if you breach any term of the Tutor Terms or;</p>\r\n<p>a) If you provide us with any information and we subsequently discover that it is incomplete, untrue, inaccurate, false or out of date;</p>\r\n<p>b) Your performance as an online tutor is in our opinion not satisfactory;</p>\r\n<p>c) You act in any way that may bring us into disrepute;</p>\r\n<p>d) You are convicted of any criminal offence or are the subject of any type of enquiry or investigation which in our opinion could affect your role as an online tutor.</p>\r\n<p>e) You fail to carry out your duties.&nbsp;</p>\r\n<p>13.2 For the avoidance of doubt if we terminate under clause 13.1 (a) - (e) You shall not be entitled to any compensation for termination but We shall pay You for any Tutoring Sessions already undertaken for which there are no disputes or complaints.</p>\r\n<h3><strong>14. CRB</strong></h3>\r\n<p>14.1&nbsp;<strong>Disclosure Information&nbsp;</strong>- is Our request to You and Your compliance to Us of all information revealing Your criminal history as required when applying for a Criminal Records Bureau (<strong>CRB</strong>)check&nbsp;</p>\r\n<p>14.2 A CRB check is a background check that is performed by the Criminal Records Bureau. It is essential that all people working with children or vulnerable adults are able to produce a current clear 'enhanced disclosure' before taking up their post or in this situation before providing tutoring services as contemplated by these Terms.</p>\r\n<p>14.3 Current legislation does not allow individuals or the self-employed to apply for a CRB check themselves. However We can assist you with Your application. We can pass Your details to MG Care Executive of Unit 4 Gidleys Meadow, Christow, Exeter, Devon, EX6 7QB which is an agency that will be happy to apply on your behalf. You must provide us with such Disclosure Information We request before the CRB check is carried out. We may ask for additional information where necessary.&nbsp;</p>\r\n<p>14.4 We strongly advise you to make sure an application is made as soon as possible, even if you do not intend to start teaching straight away.</p>\r\n<p>14.5 If you are based outside of the UK you will need to apply for the equivalent in your home jurisdiction. In this situation please contact us directly and we will discuss this with you.</p>\r\n<p>14.6 The CRB Check will be funded by you.</p>\r\n<p>14.7 You must immediately inform us in writing of any criminal conviction you receive whilst registered with Us or of anything that may affect the CRB check were you to apply for an up to date CRB check.</p>\r\n<p>14.8 You agree to provide Us with a copy of the CRB check.</p>\r\n<p>14.9 You will provide us with an up to date CRB check on request from Us.</p>\r\n<p>14.10 You agree not to accept any Students via the site without first undergoing a CRB check.</p>\r\n<h3><strong>15. Liability, limitation and other exclusions</strong></h3>\r\n<p>15.1 You shall keep Us fully indemnified in full against all costs, expenses, damages and losses (whether direct or indirect), including any interest, fines, legal and other professional fees and expenses awarded against or incurred or paid by Us as a result&nbsp;of&nbsp;or in connection with:</p>\r\n<p>a) any claim made against Us by a third party, including for the avoidance of doubt any Student, arising out&nbsp;of, or in connection with, the provision by you on Online Tutoring services or in anyway connected to any agreement between us or under these Tutor Terms;</p>\r\n<p>b) any claim brought against us for actual or alleged infringement of a third party's intellectual property rights arising out of or in connection arising out&nbsp;of, or in connection with, the provision by you on Online Tutoring services or in anyway connected to any agreement between us or under these Tutor Terms;</p>\r\n<p>15.2 You agree that subject to clause 15.3 We shall not be liable in contract, tort or negligence, statutory duty or otherwise, for any direct, indirect, special or consequential loss or damage whatsoever or howsoever arising from or in any way connected to any agreement entered into between Us and You, in connection with the provision of Online Tutoring Services or under these Tutor Terms, including without limitation (whether direct or indirect) damage for loss of business, loss of profits, financial loss of or any damage to any software or date or other intangible assets, loss of or damage to any equipment, software, hardware or property and including any loss that may not be reasonably foreseeable even where we have been notified of any such potential loss. &nbsp;</p>\r\n<p>15.3 Nothing in this clause shall limit or exclude any liability for death or personal injury if caused by negligence, nor for fraudulent misrepresentation or other liability which may not be lawfully excluded or limited under applicable law.</p>\r\n<p>15.4 Each of the exclusions of liability listed above in clause 15.2 shall be construed separately, and if any one or more is found to be unenforceable the others shall still remain in full force and effect.</p>\r\n<p>15.5 Other than in accordance with the terms of these Tutor Terms Our total liability (including any interest) in contract, tort (including negligence or breach of any statutory duty) shall be limited to the amount paid to You under these Terms in a one year period or part thereof if your initial Tutor Session was less than one year from the date the liability arose.</p>\r\n<h3><strong>16. Information about us and how to contact us</strong></h3>\r\n<p>16.1 We are a company registered in England and Wales. Our company registration number is 7889415 and Our registered office is at c/o Shelley Stock Hutter LLP, 1st Floor, 7-10 Chandos Street, London, W1G 9DQ.&nbsp;</p>\r\n<p>16.2 If you have any questions or if you have any complaints, please contact Us. You can contact Us by e-mailing Us at&nbsp;<a href="mailto:support@universaltutors.com">support@wizoku.com</a>.</p>\r\n<p>16.3 If you wish to contact Us in writing, or if any clause in these Terms requires you to give Us notice in writing (for example, to cancel the contract), you can send this to Us by e-mail to support@wizoku.com. We will confirm receipt of this by contacting you in writing. If We have to contact you or give you notice in writing, We will do so by e-mail, by hand, or by pre-paid post to the address you provide to Us.&nbsp;</p>\r\n<h3><strong>17. How we may use your personal information</strong></h3>\r\n<p>17.1 You will provide us with certain data and personal information in accordance with these Tutor Terms. You agree that we shall be entitled to use any data provided by you in accordance with Our&nbsp;<a href="/privacy-policy/">Privacy policy</a>.</p>\r\n<p>17.2 We confirm that we shall comply with all relevant UK Data protection rules, regulations and legislation as in force from time to time.</p>\r\n<p>17.3 We will use the personal information you provide to Us to:</p>\r\n<p>a) provide the Services;</p>\r\n<p>b) process your payment for such Services; and</p>\r\n<p>c) inform you about similar products or services that We provide, but you may stop receiving these at any time by contacting Us.</p>\r\n<p>17.4 You agree that We may pass your personal information to the Police or any government authority if requested by them in investigating any illegal activity or to provide information to them concerning any activity carried out by You whilst contracted under these Tutor Terms, or if compelled to do so by law or if in our opinion it may protect third party. &nbsp;</p>\r\n<p>17.5 Under The Data Protection Act 1998 You have the right to gain access to all of the confidential personal data that We may hold about you. If you wish to have access to this please contact us&nbsp;<strong><em>support@wizoku.com</em></strong>.</p>\r\n<p>17.6 If You have not had an active account within 7 years we may destroy all information we hold regarding You.&nbsp;</p>\r\n<p>17.7 We will not give your personal data to any other third party other than in accordance with this clause 17.</p>\r\n<h3><strong>18. Other important terms</strong></h3>\r\n<p>18.1 We reserve Our right to modify or discontinue, temporarily or permanently, any of these Tutor Terms or any service we provide to any Student without notice to you and You accept and confirm that we shall have no liability to You for any modification or discontinuance.&nbsp;</p>\r\n<p>18.2 We may without reference or notice to You transfer or assign Our rights and obligations under these Tutor Terms to any another third party or organisation.&nbsp;</p>\r\n<p>18.3 You may not transfer or assign your rights or your obligations under these Tutor Terms.&nbsp;</p>\r\n<p>18.4 The contract is between You and Us. No other person shall have any rights to enforce any of its terms.&nbsp;</p>\r\n<p>18.5 Nothing in the Tutor Terms is intended to, or shall be deemed to constitute a partnership or joint venture of any kind between Us and You, nor appoint either Us or You the other's agent for any purpose.</p>\r\n<p>18.6 We have the following security on the Site:- cross site scripting (xss) protection, cross site request forgery (CSRF) protection, SQL injection protection. Clickjacking protection. All passwords are hashed.&nbsp;</p>\r\n<p>18.7 Each of the paragraphs of these Terms operates separately. If any court or relevant authority decides that any of them are unlawful, the remaining paragraphs will remain in full force and effect.</p>\r\n<p>18.8 If We fail to insist that you perform any of your obligations under these Terms, or if We do not enforce Our rights against you, or if We delay in doing so, that will not mean that We have waived Our rights against you and will not mean that you do not have to comply with those obligations. If We do waive a default by you, We will only do so in writing, and that will not mean that We will automatically waive any later default by you.&nbsp;</p>\r\n<p>18.9 These Tutor Terms and any policies referred to in them together with the registration form shall constitute the entire agreement between Us and You and shall supersede all previous agreements. &nbsp;</p>\r\n<p>18.10 These clauses shall continue in force following the termination of this agreement, 8 Dispute Resolution, 10 Confidentiality, 11 Intellectual Property Rights15 Limitation of Liability 18.11 Jurisdiction.<strong><em>&nbsp;</em></strong></p>\r\n<p>18.11 These Terms are governed by English law. You and We both agree to submit to the exclusive jurisdiction of the English courts.</p>\r\n<h3><strong><br /></strong></h3>\r\n<h3><strong>Schedule - Code of Conduct</strong></h3>\r\n<p>1. All information provided to wizoku by the Tutor about him or herself shall be true, accurate, complete, up to date and not misleading. If this information changes at any time the Tutor shall as soon as possible provide updated information to wizoku.</p>\r\n<p>2 The Tutor shall be at least eighteen years of age and has the necessary qualification and experience to provide the tuition in the subject(s) he or she offers in their profile on the Site;</p>\r\n<p>3. The Tutor shall comply with clause 14 - CRB.</p>\r\n<p>4. The Tutor shall not provide to any Student any identifying information including, but not limited to, phone number, e-mail address, postal address or website address; nor shall</p>\r\n<p>5. The Tutor request from any Student any information that could allow the Student to be personally identified including, but not limited to, phone number, e-mail address, home address, postal address, web-site address or details of any organisation, school or body of which he or she is a member;</p>\r\n<p>6. If a Student supplies or attempts to supply any personal information including but not limited to the information set out in paragraph 5 above the Tutor shall immediately notify wizoku.</p>\r\n<p>7. No material used by the Tutor in the course of provision of online tutoring services will be offensive or defamatory and it will not infringe any UK laws or any applicable foreign laws (including laws relating to copyright);</p>\r\n<p>8. All Students will be treated with respect and the Tutor shall participate fully and professionally in all applicable online tutoring sessions.</p>
3	terms_and_conditions_parent		<p>Relating to the use of the wizoku Website and any Services provided by wizoku.</p>\r\n<h3>1. Interpretation</h3>\r\n<p>The definitions in this clause apply to these Terms.<br />Headings do not affect the interpretation of these Terms.</p>\r\n<p><strong>Cooling Off Period:</strong>&nbsp;the period of 7 working days commencing on the day after the date of creation of a binding contract between You and wizoku in accordance with clause 11.1.</p>\r\n<p><strong>Contract:</strong>&nbsp;means a Contract between You and Us as set out in clause 9 of these Terms.</p>\r\n<p><strong>Initial Session:</strong>&nbsp;In respect of a Tutor Session that has been booked for a time period of 30 minutes the Initial Session is a five minute period, for a Tutor Session that has been booked for a time period in excess of 30 minutes then the Initial Session is a ten minute period which the Tutor provides at no cost to the Student. After the Initial Session has lapsed the You can decide whether to proceed with the Session by confirming by ticking the pop up box if You decide to proceed then the session will become chargeable.</p>\r\n<p><strong>Privacy Policy:</strong>&nbsp;means the wizoku privacy policy from time to time in force&nbsp;(<a href="/privacy-policy/">http://wizoku.com/privacy-policy/</a>).</p>\r\n<p><strong>Service:</strong>&nbsp;the provision of online tutoring and support for Students including but not limited to the provision of online Tutors, Virtual Classrooms, enabling software and general website functionality accessed via the wizoku Website. The Site allows independent Tutors to advertise their tutoring services to you. You can book a tuition session with the Tutor you have chosen through the website. For the avoidance of doubt all Tutors and self employed and wizoku accepts no responsibility for any Tutor nor any service provided by them.</p>\r\n<p><strong>Student:</strong>&nbsp;means you or a minor on whose behalf you are contracting.</p>\r\n<p><strong>Student Account:</strong>&nbsp;an account which is created by You and holds all Student information, content and resources and can be accessed by You via Your Account and by using your unique username and password.</p>\r\n<p><strong>Terms:</strong>&nbsp;these terms and conditions and any other document or policy referred to in these terms and conditions.</p>\r\n<p><strong>Tuition Session:</strong>&nbsp;means a pre-booked tutorial with a Tutor in a Virtual Classroom which shall be for a minimum of 30 minutes and there after for time periods of 15 minutes.</p>\r\n<p>Tutor: a self-employed tutor who is registered on the Website who provides online tuition to Students via the Website.</p>\r\n<p><strong>Wizoku:</strong>&nbsp;<a>www.wizoku.com</a>&nbsp;and we, our or us. References to wizoku in these Terms shall be deemed to be a reference to Minerva Education Limited whose registered office is c/o Shelley Stock Hutter, 1st Floor, 7-10 Chandos Street, London, W1G 9DQ.</p>\r\n<p><strong>User Content:</strong>&nbsp;content (including without limitation materials, information, communications and ideas) in any format which is communicated, uploaded or otherwise transmitted or posted by You to the website by any means.</p>\r\n<p><strong>Virtual Classroom:</strong>&nbsp;the live internet broadcast within the Website where You and the Tutor meet at a pre-arranged time to take part in a private Tuition Session.</p>\r\n<p><strong>Website:</strong>&nbsp;<a>www.wizoku.com</a>&nbsp;and any software or content which is available for download from the Website.</p>\r\n<p><strong>WebSite Content:</strong>&nbsp;all other information contained in or published on the wizoku website other than information communicated, uploaded, transmitted or published by You.</p>\r\n<p><strong>You:</strong>&nbsp;the Student or the person (including a minor) on whose behalf you are contracting.</p>\r\n<p><strong>Your Account:</strong>&nbsp;means the Student Account.</p>\r\n<p>1.1. All and any business undertaken by wizoku and You is transacted subject to these Terms. In the event of any conflict between these Terms and any other terms and conditions, these Terms shall prevail unless expressly otherwise agreed in writing by us. No variation of these Terms shall be valid if made without the written consent of wizoku. These Terms shall supersede any previous Terms.</p>\r\n<p>1.2. Offer and acceptance: By clicking the acceptances box, we accept your offer and at which point and on which date the Contact shall come into existence. If you are a parent, guardian, or other person contracting on behalf of a minor to access the Service, you confirm and represent that you have the authority to do so and agree to be primarily liable for any liability whatsoever arising from the acts or omissions of such minor.</p>\r\n<h2>2. The Service</h2>\r\n<p>2.1. Through the Website and using the Service, Students can connect with independent, self-employed Tutors who provide Tuition Sessions in Virtual Classrooms. The Service includes, without limitation, the provision of:</p>\r\n<p>2.1.1. the opportunity to review profiles of tutors in a number of different subjects; and<br />2.1.2. to contract with a Tutor who will provide online tuition by a Tutor in a Virtual Classroom;</p>\r\n<p>2.1.2.1. You are solely responsible for all service, telephony and/or other fees and costs associated with Your access to and use of the Service; for obtaining and maintaining all telephone, computer hardware and other equipment required for such access and use; and for procuring, maintaining and paying for the latest available version of security software to protect against the transmission of viruses and other computer malware during Your access to and use of the Service.</p>\r\n<p>2.2. As an online service wizoku may periodically be unavailable as we perform regular maintenance and upgrades. Where reasonably possible, these activities shall be notified to You by posting any such changes on the Website. However, wizoku makes no warranty, guarantee or representation as to, and accepts no liability for, the availability or suitability of the Website and/or the Service</p>\r\n<p>2.3 Wizoku may vary the Services at any time (including but not limited to) to:</p>\r\n<p>(a) comply with any legal, statutory or regulatory requirements;<br />(b) change the fees payable in respect of the Services;<br />(c) withdraw any Service Features;<br />(d) maintain the integrity of security of the Services.</p>\r\n<h3>3. Registration</h3>\r\n<p>To use the Service, You will need to:</p>\r\n<p>(a) register on the Website and set up an account with a username and password (the&nbsp;<br />information provided by You will be stored and used in accordance with the Privacy Policy&nbsp;(<a href="/privacy-policy/">http://wizoku.com/privacy-policy/</a>);</p>\r\n<p>(b) pay the fees in accordance with clause 4 in order to take a Tuition Session;</p>\r\n<h3>4. Payment</h3>\r\n<p>4.1 When booking a Tuition Session you accept the fees for the Tuition Session advised to you in writing by the Tutor (Fees);&nbsp;<br />4.2 For the avoidance of doubt the Fee charged by the Tutor to You for a Tuition Session will not be less than &pound;5 for a 30 minute Tuition Session and there after &pound;2.50 per 15 minutes.</p>\r\n<p>4.3 You shall make payment, in accordance with the instructions on the Website, for any Tuition Sessions or other products and services offered by wizoku in advance of the Services or products being provided.</p>\r\n<p>4.4 Twenty percent (20%) of Fees paid shall be to Us in respect of the provision of the Virtual Classroom, access to the Website and the remainder is the fee you agree to pay to the Tutor.<br /><br />4.5 Wizoku reserves the right to make changes to the Fees at any time and any such changes shall immediately become effective once posted on the Website unless a booking was made prior to the change in which case the fees for that Tuition Session shall be charged the fees as advised to you in writing by the Tutor at the time of booking.</p>\r\n<h3>5. Tuition Session Monitoring and Recordings</h3>\r\n<p>5.1 Wizoku may record all or any part of a Tuition Session for quality control and other purposes and reserves its rights to review the Tuition Session for any purpose.</p>\r\n<p>5.2 However wizoku are under no obligation to oversee, monitor or moderate any interactive service provided on the Website including the Virtual Classroom, instant messaging and private messaging. and we expressly exclude our liability for any loss or damage arising from the use of any interactive service by a user in contravention of our Terms, whether the service is monitored or not.</p>\r\n<p>5.3 The use of any of our interactive services (including the Virtual Classroom) by a minor is subject to the consent of their parent or guardian. In this situation the parent or guardian hereby agrees to monitor any use of an interactive service by the minor.</p>\r\n<p>5.4 By entering into these Terms You agree that wizoku own all transcripts and recordings of Tuition Sessions and all comments that You may provide to us on or through the Website, the Services or any other means, such as part of user satisfaction or other similar surveys. You hereby agree (where appropriate by way of present assignment of future rights) to assign to wizoku all and/or any rights you may have in any such transcripts and comments.</p>\r\n<p>5.5 Your Tuition Session shall be recorded and the recorded audio, IM and white board activity (but not video) shall be stored in yours and the Tutors account for a minimum period of 3 months. If you access the recording at any time the 3 month period will be extended for a further 3 month period. The time can be extended an unlimited amount of times but this is subject to the sole discretion of wizoku.</p>\r\n<p>5.6 Initial Tutor Sessions</p>\r\n<p>5.6.1 You will be entitled to an Initial Session with a Tutor which will not be charged to You if You decide not to proceed with the Tuition Session.</p>\r\n<p>5.6.2 Once the Initial Session has lapsed a pop up box will appear on the screen if you tick it to confirm you wish to proceed then the Tuition Session will proceed and the Tuition Session will become chargeable in full.</p>\r\n<h3><br />6. Links to other Websites and Services</h3>\r\n<p>6.1 Where the Website contains links to other sites and resources provided by third parties, these links are provided for your information only. Wizoku have no control over the contents of those sites or resources and accept no responsibility for them or for any loss or damage that may arise from your use of them.<br />6.2 Any concerns regarding such links should be emailed to support@wizoku.com.</p>\r\n<h3>7. CRB Checks</h3>\r\n<p>All Tutors registered with Us will be required to have a valid CRB Check from the date that they register with Us.</p>\r\n<h3>8. Conduct in respect of the Website and the Services</h3>\r\n<p>8.1 You may only use and access the Website and use the Services for lawful purposes; and You are prohibited from posting or transmitting to or from the Website any material that it threatening, defamatory, obscene, indecent, seditious, offensive, pornographic, abusive, liable to incite racial hatred, discriminatory, menacing, scandalous, inflammatory, blasphemous, in breach of confidence, in breach of privacy or which may cause annoyance or inconvenience; or<br />(a) for which you have not obtained all necessary licences and / or approvals; or<br />(b) for the any purpose which attempts to or does harm minors in any way; or<br />(c) which constitutes or encourages conduct that would be considered to be a criminal offence, give rise to a civil liability, or otherwise be contrary to the law of or infringe the rights of any third party, in any country in the world; or<br />(d) which is technically harmful (including without limitation, computer viruses, logic bombs, Trojan horses, worms, harmful components, corrupted date or other malicious software or harmful data).</p>\r\n<p>8.2 You must not misuse the Website (including, without limitation, by hacking).<br />8.3 We shall fully co-operate with any law enforcement authorities or court order requesting or directing us to disclose the identity or locate anyone posting any material in breach of clauses 8.1 and 8.2.</p>\r\n<p>8.4 You agree that you:</p>\r\n<p>(a) shall treat the Tutors with respect and not use obscenities in the Virtual Classroom, make threats, or discuss matters other than those directly related to the academic subject for which You seek help; and<br />(b) shall not disclose any information to a Tutor that could be considered personally identifiable information including Your full name, address, telephone number, email address, national insurance number, password or any other information that could be used to identify or locate You. A violation of this agreement may lead to a suspension of Your Account; and&nbsp;<br />(c) will not request, solicit or attempt to solicit any such information from any Tutor and if any Tutor does disclose any such information or suggests any meeting or conversation not through the Website you will immediately report this to wizoku.<br />(d) You acknowledge that we may screen User Content, and that we shall have the right (but not the obligation), in our sole discretion, to remove any User Content. We may terminate any Tuition Session where we consider, in our sole discretion, that a user is uploading or otherwise transmitting inappropriate content. Without limiting the foregoing, we have the right to remove any User Content that violates these Terms or is otherwise, in wizoku&rsquo;s sole opinion, objectionable.</p>\r\n<h3>9. Formation of contract:</h3>\r\n<p>A contract between wizoku and you will be formed when:-</p>\r\n<p>(a) You register or have already registered on the Website; and</p>\r\n<p>(b) We have contacted you to confirm registration was successful. From this point the contact between us will be binding.</p>\r\n<h3>10. Confidential Information</h3>\r\n<p>Whilst accessing the Website you will have access to Website Content and information provided during the Services (Information) You confirm that you will not without wizoku&rsquo;s prior written approval use or disclose this information to any person other than in accordance with these Terms.</p>\r\n<h3>11. Termination</h3>\r\n<p>11.1 We may terminate the Contract in accordance with these Terms at any time by providing You with notice of such termination, which shall be effective immediately upon notification to You.<br />11.2 We may terminate these Terms immediately without notice for any breach by You of these Terms or any policies referred to in these Terms, as posted on the website from time.<br />11.3 You shall be entitled to terminate the session at any time up to 5 minutes into the Session (Initial Period) unless you do not turn up for the Initial Period in which case you will be charged in full for the booked session.<br />11.4 Termination will not affect our outstanding rights, including our right to recover from you any money you owe us under these Terms.&nbsp;<br />11.5 These clauses shall continue in force following the termination or expiration of these Terms, 11 Dispute Resolution, 10 Confidentiality, 8 Conduct, 13 Limitation of Liability, 12 Indemnification and 16 Jurisdiction.&nbsp;<br />11.6 You agree that upon the termination of these Terms, we may block access by you to the Website and prevent You from using the Services.&nbsp;<br />11.7 Upon the termination of these Terms You will immediately destroy any downloaded, printed or otherwise stored Website Content.</p>\r\n<h3>12. Indemnification</h3>\r\n<p>12.1 You agree to indemnify and to hold wizoku harmless in full immediately on demand, against all claims, liability, damages, costs and expenses, including legal fees on an indemnity basis, arising out of:<br />12.1.1 any breach of these Terms<br />12.1.2 the infringement of any intellectual property or other right of any person or entity, or<br />12.1.3 any other liabilities arising out of the use of or access to the website and Service by You or by any other person using Your computer, Your password and/or Your log in details.</p>\r\n<h3>13. Limitation of Liability &ndash; YOUR ATTENTION IS PARTICULARILY DRAWN TO THIS CLAUSE</h3>\r\n<p>13.1 Nothing in these Terms shall limit our liability to you for:-<br />(a) death or personal injury caused by our negligence; or<br />(b) fraud or fraudulent misrepresentation.</p>\r\n<p>13.2 Subject to clause 13.2 we shall under no circumstances whatsoever be liable to you (whether in contract, tort (including negligence) breach of statutory duty or otherwise for any loss of profit or any indirect or consequential loss arising under or in connection with the Contract; and<br />13.3 Our total liability to You in respect of all other losses arising under or in connection with the Contract whether in contract, tort (including negligence) breach of statutory duty or otherwise shall in no circumstances exceed the amount paid by You to us in any one year period or if you contracted with us les than one year from the date of the claim then the amount shall be limited to the amount paid by You to Us during that period.</p>\r\n<h3>14. No Waiver</h3>\r\n<p>No waiver by wizoku shall be construed as a waiver of any preceding or subsequent breach of any provision. Wizoku&rsquo;s failure to exercise or enforce any right or provision of these Terms shall not constitute a waiver of such right or provision unless acknowledged and agreed to by wizoku in writing.</p>\r\n<h3>15. Entire Agreement</h3>\r\n<p>These Terms constitute the entire agreement between us and supersedes any previous agreement between us.</p>\r\n<h3>16. Jurisdiction</h3>\r\n<p>These Terms shall be governed by English law and both parties agree to submit to the exclusive jurisdiction of the English Courts.</p>\r\n<h3>17. Assignment</h3>\r\n<p>17.1 Wizoku may transfer, assign or subcontract Our rights and obligations under these Terms to any other party without notice to you.<br />17.2 You may not transfer, assign or subcontract any of your rights and obligations under these Terms other than in accordance with these Terms or if previously agreed by us in writing.</p>\r\n<h3>18. Third party rights</h3>\r\n<p>Save in respect of a minor whose parent or guardian has contracted on their behalf, a person who is not a party to this Agreement shall not have any rights under or in connection with it.</p>\r\n<h3>19. No partnership or agency</h3>\r\n<p>Nothing in this Agreement is intended to, or shall be deemed to, constitute a partnership or joint venture of any kind between any of the parties, nor constitute any party the agent of another party for any purpose unless expressly provided in these terms and conditions.</p>\r\n<h3>20. Force majeure</h3>\r\n<p>Wizoku shall not be in breach of these Terms nor liable for delay in performing, or failure to perform, any of its obligations under this agreement if such delay or failure result from events, circumstances or causes beyond its reasonable control.&nbsp;In such circumstances&nbsp;wizoku shall be entitled to a reasonable extension of the time for performing such obligations, provided that if the period of delay or non-performance continues for 14 days, you may terminate the Contract by giving 7 days written notice to wizoku.</p>\r\n<h3>21. Severability</h3>\r\n<p>If any provision of this Agreement may prove to be invalid or unenforceable in any way, the other provisions of this Agreement and the remainder of the provision in question shall remain in full force and effect.</p>\r\n<h3>22. Cancellation</h3>\r\n<p>You shall be entitled to terminate a Tuition Session at any time up to 5 minutes into the Session (Initial period) unless you do not turn up for the Session in which case you will be liable for the entire booked Session.</p>\r\n<h3>23. Data Protection</h3>\r\n<p>23.1 You will provide us with certain data and personal information in accordance with these Terms. You agree that we shall be entitled to use any data provided by you in accordance with Our Privacy policy&nbsp;(<a href="/privacy-policy/">http://wizoku.com/privacy-policy/</a>).<br />23.2 We confirm that we shall comply with all relevant UK Data protection rules, regulations and legislation as in force from time to time.<br />23.3 We will use the personal information you provide to Us to:<br />(a) provide the Services;<br />(b) process your payment for such Services; and<br />(c) inform you about similar products or services that we provide, but you may stop receiving these at any time by contacting Us.<br />23.4 You agree that We may pass your personal information to the Police or any government authority if requested by them in investigating any illegal activity or to provide information to them concerning any activity carried out by You whilst contracted under these Terms, or if compelled to do so by law or if in our opinion it may protect third party.&nbsp;<br />23.5 Under The Data Protection Act 1998 you have the right to gain access to all of the confidential personal data that We may hold about you. If you wish to have access to this please contact us support@wizoku.com.<br />23.6 If you have not had an active account within 7 years we may destroy all information we hold regarding You.&nbsp;<br />23.7 We will not give your personal data to any other third party other than in accordance with this clause 22.</p>\r\n<h3>24. Complaints Process &amp; Dispute Resolution</h3>\r\n<p>If you have any complaints please email us on support@wizoku.com and we will endeavour to respond to you within 24 hours to confirm how we will deal with this issue.</p>\r\n<p>24.1. DISPUTES INVOLVING TUTORS<br />24.1.1 If at any time you become dissatisfied with any service provided to You by a Tutor or have any complaint generally you must immediately notify Us by telephone and by email support@wizoku.com.<br />24.1.2 Should We require any information or documentation from you regarding any complaint or dispute as set out above You must immediately provide this to us.<br />24.1.3 You hereby confirm that you will cooperate fully with Us in any attempts to resolve any complaint or dispute.<br />24.1.4 Should any dispute or complaint against You arise we reserve Our right to immediately suspend your Account until such time as any issue is resolved. We reserve Our right to continue to suspend your Account whilst we carry out any investigation which in Our sole opinion is necessary.</p>\r\n<p>24.2. DISPUTES BETWEEN US<br />24.2.1 If any dispute between us arises other than in accordance with clause 23.1 Us and You shall first attempt to settle the dispute amongst ourselves if we cannot resolve any issue within 7 days of either party being notified in writing of the dispute with sufficient detail to be able to consider it then the parties will attempt to settle it by mediation in accordance with the Centre for Effective&nbsp;Dispute Resolution&nbsp;(CEDR) Model Mediation Procedure.&nbsp;<br />24.2.2 Unless otherwise agreed between the parties, the mediator will be nominated by CEDR. To initiate the mediation a party must give notice in writing ("ADR notice") to the other party to the&nbsp;dispute&nbsp;requesting a mediation. A copy of the request should be sent to CEDR. The mediation will start not later than 28 days after the date of the ADR notice. No party may commence any court proceedings in relation to any&nbsp;dispute&nbsp;arising out of this agreement until it has attempted to settle the&nbsp;dispute&nbsp;by mediation and either the mediation has terminated or the other party has failed to participate in the mediation, provided that the right to issue proceedings is not prejudiced by a delay.</p>
